export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:g,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:g,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:5}}},xaEegreOwF:{data:{id:1752,attributes:{imdbId:"tt1650554",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTQ4OTQxNzc0N15BMl5BanBnXkFtZTcwOTQxOTU5OQ@@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"6.5\u002F10"},{Source:"Rotten Tomatoes",Value:"32%"},{Source:"Metacritic",Value:"41\u002F100"}],item_lang:{data:{id:2415,attributes:{title:"Kick-Ass 2",plot:"After Kick-Ass' insane bravery inspires a new wave of self-made masked crusaders, led by the badass Colonel Stars and Stripes, our hero joins them on patrol. When these amateur superheroes are hunted down by Red Mist -- reborn as The Mother F%&amp;*^r -- only the blade-wielding Hit Girl can prevent their annihilation. When we last saw junior assassin Hit Girl and young vigilante Kick-Ass, they were trying to live as normal teenagers Mindy and Dave. With graduation looming and uncertain what to do, Dave decides to start the world's first superhero team with Mindy. Unfortunately, when Mindy is busted for sneaking out as Hit Girl, she's forced to retire-leaving her to navigate the terrifying world of high-school mean girls on her own. With no one left to turn to, Dave joins forces with Justice Forever, run by a born-again ex-mobster named Colonel Stars and Stripes. Just as they start to make a real difference on the streets, the world's first super villain, The Mother F%&amp;*^r, assembles his own evil league and puts a plan in motion to make Kick-Ass and Hit Girl pay for what they did to his dad. But there's only one problem with his scheme: If you mess with one member of Justice Forever, you mess with them all.",slug:"kick-ass-2"}}},books:{data:[{id:8987,attributes:{title:"Kick-Ass: The Dave Lizewski Years Book 2",description:"This month marks 10 YEARS OF KICK-ASSthe greatest superhero comic of all time! That also means it's been 10 years since Hit-Girl, the world's deadliest tween assassin, exploded onto the scene to slaughter super villains and serve hot justice to the scum of New York City. In KICK-ASS: THE DAVE LIZEWSKI YEARS, VOL. 2, she trains a novice Kick-Ass in the lethal fighting styles she learned from Big Daddy. In return, Kick-Ass is helping her survive middle school...without any bloodshed. When Kick-Ass gets benched, Hit-Girl has to take on the mafia solo. Collects HIT-GIRL #1-5",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=kLVJDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:f,publisher:d,subtitle:b}},{id:8988,attributes:{title:"Kick-Ass: The Dave Lizewski Years Book 1",description:"This month marks 10 YEARS OF KICK-ASS the greatest superhero comic of all time! It's been a decade since teen comic book nerd Dave Lizewski donned his homemade Kick-Ass costume and took to the streets of NYC to fight the city's hardest criminals. This New York Times bestseller became a worldwide phenomenon overnight, spending three months at the top spot on the Diamond Direct Market chart and spawning the KICK-ASS movie that opened at No.1 in the box office! To celebrate the launch of the NEW KICK-ASS series, all four volumes of KICK-ASS: THE DAVE LIZEWSKI YEARS are being released through Image Comics. Relive what happens when Dave Lizewski asks himself \"How come nobody's ever become a superhero before?\" and makes his teenage superhero daydreams an ass-kicking reality. Superstar creators MARK MILLAR and JOHN ROMITA, JR. present this true 21st-century classic. Collects KICK-ASS #1-8",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=S7dJDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:e,published:f,publisher:d,subtitle:b}},{id:8989,attributes:{title:"Kick-Ass 3",description:"The grand finale of Mark Millar and John Romita Jr.'s blockbuster! Hit-Girl is in jail, leaving Kick-Ass to lead the superhero team Justice Forever. But superheroes have been outlawed, leaving Kick-Ass and to dodge both cops and some terrifying new foes! For the first time, Kick-Ass begins to doubt. Is he in too deep to get out? Meanwhile, Hit-Girl starts running all the gangs in the joint, and a broken Red Mist gets an education from a terrifying crime boss. But when the new Skull and Bones vigilante team debuts and dissension hits Justice Forever's ranks, will Kick-Ass be able to fend off a coup? Plus: The flashback you've all been waiting for...the secret origin of Hit-Girl! How does little Mindy McCready earn her assassin stripes? Find out as Kick-Ass comes to its epic conclusion! COLLECTING : Kick-Ass 3 1-8",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=WKnMngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:e,published:"2014-09-23",publisher:"Marvel",subtitle:b}},{id:8990,attributes:{title:"Kickass #1",description:"KICK-ASS IS BACKÑready to wipe out the city's criminal lowlives, destroy its gangs, and save its communities from decay. But there's a new face beneath the old mask, a new figure wearing that famous green and yellow spandex. Who is this new vigilante superhero? Who can fill Dave Lizewski's shoes? WHO IS THE NEW KICK-ASS? Find out in the first issue of this new, ongoing monthly series. Comic book legends MARK MILLAR and JOHN ROMITA, JR. reunite for the next chapter of the greatest superhero comic of all time.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=9rRJDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:e,published:f,publisher:d,subtitle:b}},{id:8991,attributes:{title:"Kick-Ass: The New Girl Vol. 1",description:"KICK-ASS IS BACK ready to wipe out the city's criminal lowlives, destroy its gangs, and save its communities from decay. But there's a new face beneath the old mask, a new figure wearing that famous green and yellow spandex. Who is this new vigilante superhero? Who can fill Dave Lizewski's shoes? WHO IS THE NEW KICK-ASS? Find out in the first collection of KICK-ASS: THE NEW GIRL. MARK MILLAR and JOHN ROMITA, JR. reunite for the next chapter of the greatest superhero comic of all time. Collects KICK-ASS: THE NEW GIRL #1-6",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=cQprDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:e,published:"2018-09-12",publisher:d,subtitle:b}}]}}},meta:{}}},prerenderedAt:1681703549255}}("Mark Millar","","movie","Image Comics",null,"2018-02-14","series",1))